                    "title": "行程安排",
                    "detail": "<p><span style=\"color:#4f81bd\"><strong>行程一（3天2晚清爽纯跑套餐）</strong></span></p><p><span style=\"color:#4f81bd\">第一天&nbsp;</span>&nbsp;中国&nbsp;-&nbsp;新加坡 &nbsp;&nbsp;&nbsp;2017年03月24日&nbsp;星期五</p><p>·&nbsp;搭乘国际航班由您所在的城市出发，飞往狮城新加坡。</p><p>·&nbsp;到达后，自行前往酒店入住休息。入住后自由活动。</p><p>·&nbsp;参考航班：北京-新加坡 &nbsp;&nbsp;SQ805&nbsp;&nbsp;08:55 -&nbsp;15:20&nbsp;</p><p>上海-新加坡&nbsp;&nbsp;&nbsp;MU567 &nbsp;&nbsp;&nbsp;09:55 - 15:35</p><p>广州-新加坡&nbsp;&nbsp;&nbsp;CZ353 &nbsp;&nbsp;&nbsp;08:40 - 12:30</p><p>成都-新加坡&nbsp;&nbsp;3U8093 &nbsp;&nbsp;14:00&nbsp;- 18:40</p><p>沈阳-新加坡 &nbsp;&nbsp;CZ351 &nbsp;&nbsp;&nbsp;13:05&nbsp;–&nbsp;22:30</p><p><br/></p><p><span style=\"color:#4f81bd\"><br/></span></p><p><span style=\"color:#4f81bd\">第二天</span>&nbsp;&nbsp;新加坡 &nbsp;&nbsp;&nbsp;2017年03月25日&nbsp;&nbsp;星期六</p><p>·&nbsp;早餐后自由活动。推荐可前往新加坡市区自由活动或到滨海湾附近熟悉一下赛道，为接下来的挑战做足准备。</p><p>·&nbsp;晚上请按照要求时间自行前往比赛场地，准备开跑！</p><p><br/></p><p><span style=\"color:#4f81bd\">第三天</span>&nbsp;&nbsp;新加坡 &nbsp;&nbsp;&nbsp;2017年03月26日&nbsp;&nbsp;星期日</p><p>·&nbsp;比赛结束后，自行返回酒店休息。</p><p>·于中午12:00前办理退房手续。退房后，行李可寄存酒店。之后自由活动。</p><p>·&nbsp;请于根据您的航班时间提前到达机场（至少起飞时间前2个半小时到达机场），办理登机手续。结束愉快的新加坡马拉松之旅！</p><p>·&nbsp;参考航班:&nbsp;新加坡-北京 &nbsp;&nbsp;SQ806&nbsp;&nbsp;16:50 - 23:00&nbsp;</p><p>新加坡-上海&nbsp;&nbsp;&nbsp;MU568 &nbsp;&nbsp;&nbsp;16:35 - 22:05 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>新加坡-广州&nbsp;&nbsp;&nbsp;CZ3040 &nbsp;&nbsp;17:50 - 22:05 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>新加坡-成都&nbsp;&nbsp;&nbsp;3U8094 &nbsp;&nbsp;19:40&nbsp;- 01:20+1</p><p>新加坡-沈阳&nbsp;&nbsp;CZ352 &nbsp;&nbsp;&nbsp;08:00 –&nbsp;17:00（此航班不适合跑全马的跑友）</p><p>&nbsp;</p><p><span style=\"color:#4f81bd\"><strong>&nbsp;行程二（4天3晚四星套餐）</strong></span></p><p><span style=\"color:#4f81bd\">第一天</span>&nbsp;&nbsp;中国&nbsp;-&nbsp;新加坡 &nbsp;&nbsp;&nbsp;2017年03月24日&nbsp;星期五</p><p>·搭乘国际航班由您所在的城市出发，飞往狮城新加坡。</p><p>·到达后，班车接机送往市区四星酒店入住休息。入住酒店后自由活动。</p><p>·&nbsp;参考航班：北京-新加坡 &nbsp;&nbsp;SQ805&nbsp;&nbsp;08:55 -&nbsp;15:20&nbsp;</p><p>上海-新加坡&nbsp;&nbsp;&nbsp;MU567 &nbsp;&nbsp;&nbsp;09:55 - 15:35</p><p>广州-新加坡&nbsp;&nbsp;&nbsp;CZ353 &nbsp;&nbsp;&nbsp;08:40 - 12:30</p><p>成都-新加坡&nbsp;&nbsp;3U8093 &nbsp;&nbsp;14:00&nbsp;- 18:40</p><p>沈阳-新加坡 &nbsp;&nbsp;CZ351 &nbsp;&nbsp;&nbsp;13:05&nbsp;–&nbsp;22:30</p><p><br/></p><p><span style=\"color:#4f81bd\">第二天&nbsp;</span>&nbsp;新加坡 &nbsp;&nbsp;&nbsp;2017年03月25日&nbsp;&nbsp;星期六</p><p>·酒店早餐后，自由活动。推荐可前往新加坡市区自由活动或到滨海湾附近熟悉一下赛道。为接下来的挑战做足准备。</p><p>·&nbsp;推荐景点：</p><p>鱼尾狮公园（Merlion&nbsp;Park）：</p><p>鱼尾狮像坐落于市内新加坡河畔鱼尾狮公园内，是新加坡的标志和象征。塑像由雕刻家林南先生和他的两个孩子共同雕塑完成，每年来自全球一百多万的游客都会专程造访鱼尾狮公园，与世界著名的鱼尾狮拍照留念。高8米的狮子口中喷出一股清水，汇入新加坡河中。公园周围还聚集了很多新加坡著名的地标性建筑，如滨海艺术中心、政府大厦、高等法院、维多利亚剧院、莱佛士铜像等，是徒步游览的不二之选。</p><p><img src=\"http://thumb.huway.com/huway/upload/2016/08/26/20160826095445584491.jpg\" _src=\"http://thumb.huway.com/huway/upload/2016/08/26/20160826095445584491.jpg\"/></p><p>滨海湾花园（Gardens&nbsp;By The Bay）：</p><p>这座位于市中心的超级花园成为新加坡最新的地标，游客可在花园中巨大的半球形温室里观赏到超过25万棵奇花异草，和全球最大的室内瀑布。园区共分成三个部分： 滨海南花园、滨海东花园，以及衔接二者的滨海中花园。其中建有多棵巨大的超级树，十分引人注目。 这些超级树其实是一座座 16层楼高的垂直花园，您在树顶可以鸟瞰整个花园景色。</p><p>·&nbsp;晚上请按照要求时间自行前往比赛场地，准备开开跑！</p><p><img src=\"http://thumb.huway.com/huway/upload/2016/08/26/20160826095605223235.jpg\" _src=\"http://thumb.huway.com/huway/upload/2016/08/26/20160826095605223235.jpg\" style=\"width: 716px; height: 483px;\"/></p><p><span style=\"color:#4f81bd\">第三天</span>&nbsp;&nbsp;新加坡 &nbsp;&nbsp;&nbsp;2017年03月26日&nbsp;&nbsp;星期日 &nbsp;</p><p>·跑步结束后，返回酒店。可在酒店享用一顿丰盛的早餐后回到酒店休息。</p><p>·&nbsp;休息之后，自由活动</p><p>·&nbsp;推荐景点：</p><p>乌节路 （Orchard Road）</p><p>乌节路是新加坡大名鼎鼎的购物地带，拥有着十几家大型购物大厦，从顶级奢侈品到大众名牌服饰应有尽有。乌节路能带给你的决不仅仅是疯狂血拼的乐趣。就算不打算购物，你也可以沿街漫步，欣赏精美橱窗，流连于街头巷尾的艺术名作。</p><p>&nbsp;<img src=\"http://thumb.huway.com/huway/upload/2016/08/26/20160826095753615716.jpg\" _src=\"http://thumb.huway.com/huway/upload/2016/08/26/20160826095753615716.jpg\"/></p><p><span style=\"color:#4f81bd\">第四天</span>&nbsp;&nbsp;新加坡 &nbsp;&nbsp;&nbsp;2017年03月27日&nbsp;&nbsp;星期一</p><p>·&nbsp;早餐后您需要于中午12:00之前办理退房手续。退房后，行李可寄存酒店。之后自由活动。</p><p>·&nbsp;请于规定的时间回到酒店集合，我们会根据航班时间安排送机服务。</p><p>·&nbsp;到达机场后办理登机手续。结束愉快的新加坡马拉松之旅！</p><p>·&nbsp;参考航班:&nbsp;新加坡-北京 &nbsp;&nbsp;SQ806&nbsp;&nbsp;16:50 - 23:00&nbsp;</p><p>新加坡-上海&nbsp;&nbsp;&nbsp;MU568 &nbsp;&nbsp;&nbsp;16:35 - 22:05 &nbsp;&nbsp;</p><p>新加坡-广州&nbsp;&nbsp;&nbsp;CZ3040 &nbsp;&nbsp;17:50 - 22:05 &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p><p>新加坡-成都&nbsp;&nbsp;&nbsp;3U8094 &nbsp;&nbsp;19:40&nbsp;- 01:20+1</p><p>新加坡-沈阳&nbsp;&nbsp;CZ352 &nbsp;&nbsp;&nbsp;08:00 –&nbsp;17:00</p><p><br/></p>"
