            "<p><span style=\"color:#4f81bd\"><strong>【酒店+名额，3天2晚清爽套餐】</strong></span></p><p><img src=\"http://thumb.huway.com/huway/upload/2016/08/25/20160825175743446368.png\" _src=\"http://thumb.huway.com/huway/upload/2016/08/25/20160825175743446368.png\" style=\"width: 469px; height: 228px;\"/></p><p>·价格包含：</p><p>1.&nbsp;新加坡三星Marrison &nbsp;Hotel或同级酒店住宿2晚，2人1间住宿费用及酒店早餐。</p><p>2.&nbsp;新加坡Sundown马拉松名额费。</p><p>3.&nbsp;境外旅游保险。</p><p>&nbsp;</p><p>·价格不含：</p><p>1、&nbsp;新加坡往返机票费用及税费。</p><p>2、&nbsp;如单人入住，或携带家属同行，单房差1050元/人</p><p>3、&nbsp;当地用车及当地游览等费用。</p><p>4、&nbsp;新加坡签证费（可提供代办签证服务，380/人）。</p><p>5、&nbsp;当地午晚餐等其它个人消费。</p><p>6、&nbsp;价格包含中不含的其它费用。</p><p>7、&nbsp;因不可抗拒的客观原因（如天灾，战争，罢工等）,航空公司航班延误或取消，领馆签证延误等特殊情况而产生的额外费用。</p><p>机票参考价格：往返含税</p><p>北京-新加坡：3300元/人</p><p>上海-新加坡：3000元/人</p><p>广州-新加坡：2000元/人</p><p>成都-新加坡：2200元/人</p><p>深圳-新加坡：3400元/人</p><p>备注：机票价格为参考价格，最终以实际出票价格为准</p><p><br/></p><p><span style=\"color:#4f81bd\"><strong>【4天3晚四星套餐】</strong></span></p><p><span style=\"color:#4f81bd\"><strong><img src=\"http://thumb.huway.com/huway/upload/2016/08/25/20160825180034719877.png\" _src=\"http://thumb.huway.com/huway/upload/2016/08/25/20160825180034719877.png\" style=\"width: 478px; height: 239px;\"/></strong></span></p><p><span style=\"color:#4f81bd\"><strong></strong></span></p><p>·价格包含：</p><p>1.&nbsp;新加坡四星级滨海湾乐雅或同级酒店住宿2晚，2人1间住宿费用及酒店早餐。</p><p>2.&nbsp;新加坡Sundown马拉松名额费。</p><p>3.&nbsp;酒店-机场定点班车接送服务。（班车时间以参考航班时间为参考标准）</p><p>4.&nbsp;境外旅游保险。</p><p>&nbsp;</p><p>·价格不含：</p><p>1、&nbsp;新加坡往返机票费用及税费。</p><p>2、&nbsp;如单人入住，需支付单房差，单房差费用2000元/人。家属同行，家属价 2450元/人</p><p>3、&nbsp;当地用车及当地游览等费用。</p><p>4、&nbsp;新加坡签证费（可提供代办签证服务，380/人）。</p><p>5、&nbsp;当地午晚餐等其它个人消费。</p><p>6、&nbsp;价格包含中不含的其它费用。</p><p>7、&nbsp;因不可抗拒的客观原因（如天灾，战争，罢工等）,航空公司航班延误或取消，领馆签证延误等特殊情况而产生的额外费用。</p><p>&nbsp;</p><p>机票参考价格：往返含税</p><p>北京-新加坡：3300元/人</p><p>上海-新加坡：3000元/人</p><p>广州-新加坡：2000元/人</p><p>成都-新加坡：2200元/人</p><p>深圳-新加坡：3400元/人</p><p>备注：机票价格为参考价格，最终以实际出票价格为准</p><p><span style=\"color:#4f81bd\"><strong><br/></strong></span></p>",
